  location:
    adminAddress: "address not configured yet <nobody@nowhere>"
    url: "http://anele-XPS-15-9570:8080/"
  mailer:
    adminAddress: "address not configured yet <nobody@nowhere>"
    charset: "UTF-8"
    useSsl: false
  pollSCM:
    pollingThreadCount: 10
  timestamperConfig:
    allPipelines: false
    elapsedTimeFormat: "'<b>'HH:mm:ss.S'</b> '"
    systemTimeFormat: "'<b>'HH:mm:ss'</b> '"
tool:
  ant:
    defaultProperties:
    - installSource:
        installers:
        - "antFromApache"
  git:
    installations:
    - home: "git"
      name: "Default"
  gradle:
    defaultProperties:
    - installSource:
        installers:
        - "gradleInstaller"
  jdk:
    defaultProperties:
    - installSource:
        installers:
        - jdkInstaller:
            acceptLicense: false
  maven:
    defaultProperties:
    - installSource:
        installers:
        - "maven"
